// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/// @title  A minimal ERC-721 implementation (no OZ), with metadata and safe transfers
/// @notice  Single-file ERC721 compatible contract. Minting is public (anyone can mint).
contract MyERC721 {
    // ====== ERC-165 / Interface IDs ======
    // bytes4(keccak256('supportsInterface(bytes4)')) == 0x01ffc9a7
    bytes4 private constant _INTERFACE_ID_ERC165 = 0x01ffc9a7;
    // bytes4(keccak256('balanceOf(address)')) ^
    // bytes4(keccak256('ownerOf(uint256)')) ^
    // bytes4(keccak256('safeTransferFrom(address,address,uint256)')) ^
    // bytes4(keccak256('transferFrom(address,address,uint256)')) ^
    // bytes4(keccak256('approve(address,uint256)')) ^
    // bytes4(keccak256('getApproved(uint256)')) ^
    // bytes4(keccak256('setApprovalForAll(address,bool)')) ^
    // bytes4(keccak256('isApprovedForAll(address,address)')) == 0x80ac58cd
    bytes4 private constant _INTERFACE_ID_ERC721 = 0x80ac58cd;
    // bytes4(keccak256('name()')) ^ bytes4(keccak256('symbol()')) ^ bytes4(keccak256('tokenURI(uint256)')) == 0x5b5e139f
    bytes4 private constant _INTERFACE_ID_ERC721_METADATA = 0x5b5e139f;

    // ====== ERC-721 STORAGE ======
    string private _name;
    string private _symbol;

    // tokenId => owner
    mapping(uint256 => address) private _owners;

    // owner => balance
    mapping(address => uint256) private _balances;

    // tokenId => approved address
    mapping(uint256 => address) private _tokenApprovals;

    // owner => operator => approved
    mapping(address => mapping(address => bool)) private _operatorApprovals;

    // tokenId => tokenURI
    mapping(uint256 => string) private _tokenURIs;

    // simple incrementing token id
    uint256 private _nextTokenId = 1;

    // ====== EVENTS (ERC-721) ======
    event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);
    event Approval(address indexed owner, address indexed approved, uint256 indexed tokenId);
    event ApprovalForAll(address indexed owner, address indexed operator, bool approved);

    // ====== CONSTRUCTOR ======
    constructor(string memory name_, string memory symbol_) {
        _name = name_;
        _symbol = symbol_;
    }

    // ====== ERC-165 ======
    /// @notice Query if a contract implements an interface
    function supportsInterface(bytes4 interfaceId) public pure returns (bool) {
        return
            interfaceId == _INTERFACE_ID_ERC165 ||
            interfaceId == _INTERFACE_ID_ERC721 ||
            interfaceId == _INTERFACE_ID_ERC721_METADATA;
    }

    // ====== Metadata ======
    function name() external view returns (string memory) {
        return _name;
    }

    function symbol() external view returns (string memory) {
        return _symbol;
    }

    /// @notice Return tokenURI for a tokenId, revert if not exists
    function tokenURI(uint256 tokenId) public view returns (string memory) {
        require(_exists(tokenId), "ERC721: URI query for nonexistent token");
        return _tokenURIs[tokenId];
    }

    // ====== Balance / Owner ======
    function balanceOf(address owner) public view returns (uint256) {
        require(owner != address(0), "ERC721: balance query for the zero address");
        return _balances[owner];
    }

    function ownerOf(uint256 tokenId) public view returns (address) {
        address owner = _owners[tokenId];
        require(owner != address(0), "ERC721: owner query for nonexistent token");
        return owner;
    }

    // ====== Approve / Allowance-like ======
    function getApproved(uint256 tokenId) public view returns (address) {
        require(_exists(tokenId), "ERC721: approved query for nonexistent token");
        return _tokenApprovals[tokenId];
    }

    function isApprovedForAll(address owner, address operator) public view returns (bool) {
        return _operatorApprovals[owner][operator];
    }

    /// @notice Approve address to transfer the given tokenId
    function approve(address to, uint256 tokenId) public {
        address owner = ownerOf(tokenId);
        require(to != owner, "ERC721: approval to current owner");
        require(
            msg.sender == owner || isApprovedForAll(owner, msg.sender),
            "ERC721: approve caller is not owner nor approved for all"
        );

        _tokenApprovals[tokenId] = to;
        emit Approval(owner, to, tokenId);
    }

    /// @notice Set/Unset operator approval
    function setApprovalForAll(address operator, bool approved) public {
        require(operator != msg.sender, "ERC721: approve to caller");
        _operatorApprovals[msg.sender][operator] = approved;
        emit ApprovalForAll(msg.sender, operator, approved);
    }

    // ====== Transfers ======
    function transferFrom(address from, address to, uint256 tokenId) public {
        require(_isApprovedOrOwner(msg.sender, tokenId), "ERC721: transfer caller is not owner nor approved");
        _transfer(from, to, tokenId);
    }

    /// @notice Safe transfer without data
    function safeTransferFrom(address from, address to, uint256 tokenId) public {
        safeTransferFrom(from, to, tokenId, "");
    }

    /// @notice Safe transfer with data
    function safeTransferFrom(address from, address to, uint256 tokenId, bytes memory _data) public {
        require(_isApprovedOrOwner(msg.sender, tokenId), "ERC721: transfer caller is not owner nor approved");
        _safeTransfer(from, to, tokenId, _data);
    }

    // ====== Minting (public) ======
    /// @notice Mint a new NFT to `recipient` with `tokenURI_`. Returns tokenId.
    /// @dev tokenId auto-incremented by contract.
    function mintNFT(address recipient, string memory tokenURI_) public returns (uint256) {
        require(recipient != address(0), "ERC721: mint to the zero address");

        uint256 tokenId = _nextTokenId;
        _nextTokenId += 1;

        _mint(recipient, tokenId);
        _setTokenURI(tokenId, tokenURI_);

        return tokenId;
    }

    // ====== INTERNAL HELPERS ======
    function _exists(uint256 tokenId) internal view returns (bool) {
        return _owners[tokenId] != address(0);
    }

    function _isApprovedOrOwner(address spender, uint256 tokenId) internal view returns (bool) {
        require(_exists(tokenId), "ERC721: operator query for nonexistent token");
        address owner = ownerOf(tokenId);
        return (spender == owner || getApproved(tokenId) == spender || isApprovedForAll(owner, spender));
    }

    function _mint(address to, uint256 tokenId) internal {
        require(to != address(0), "ERC721: mint to the zero address");
        require(!_exists(tokenId), "ERC721: token already minted");

        _beforeTokenTransfer(address(0), to, tokenId);

        _balances[to] += 1;
        _owners[tokenId] = to;

        emit Transfer(address(0), to, tokenId);

        _afterTokenTransfer(address(0), to, tokenId);
    }

    function _safeTransfer(address from, address to, uint256 tokenId, bytes memory _data) internal {
        _transfer(from, to, tokenId);
        require(_checkOnERC721Received(from, to, tokenId, _data), "ERC721: transfer to non ERC721Receiver implementer");
    }

    function _transfer(address from, address to, uint256 tokenId) internal {
        require(ownerOf(tokenId) == from, "ERC721: transfer of token that is not own");
        require(to != address(0), "ERC721: transfer to the zero address");

        _beforeTokenTransfer(from, to, tokenId);

        // Clear approvals from the previous owner
        _approve(address(0), tokenId);

        _balances[from] -= 1;
        _balances[to] += 1;
        _owners[tokenId] = to;

        emit Transfer(from, to, tokenId);

        _afterTokenTransfer(from, to, tokenId);
    }

    function _approve(address to, uint256 tokenId) internal {
        _tokenApprovals[tokenId] = to;
        emit Approval(ownerOf(tokenId), to, tokenId);
    }

    function _setTokenURI(uint256 tokenId, string memory _uri) internal {
        require(_exists(tokenId), "ERC721Metadata: URI set of nonexistent token");
        _tokenURIs[tokenId] = _uri;
    }

    // ====== ERC721Receiver check ======
    // bytes4(keccak256("onERC721Received(address,address,uint256,bytes)")) == 0x150b7a02
    bytes4 private constant _ERC721_RECEIVED = 0x150b7a02;

    function _checkOnERC721Received(address from, address to, uint256 tokenId, bytes memory _data) private returns (bool) {
        // if 'to' is a contract, call onERC721Received and check return value
        uint32 size;
        assembly {
            size := extcodesize(to)
        }
        if (size == 0) {
            // to is EOA
            return true;
        }

        // try calling onERC721Received on the recipient
        (bool success, bytes memory returndata) = to.call(
            abi.encodeWithSelector(_ERC721_RECEIVED, msg.sender, from, tokenId, _data)
        );

        if (!success) {
            return false;
        }

        if (returndata.length < 4) {
            return false;
        }

        bytes4 retval = abi.decode(returndata, (bytes4));
        return (retval == _ERC721_RECEIVED);
    }

    // ====== HOOKS (empty, can be extended in derived contracts) ======
    function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal virtual {}
    function _afterTokenTransfer(address from, address to, uint256 tokenId) internal virtual {}
}

